import React from "react";
import "./Gd.css";
import Be from "./img/be.png";
import In from "./img/in.png";
import Twit from "./img/twit.png";
import Insta from "./img/insta.png";
import Facebook from "./img/facebook.png";

function Gd() {
  return (
    <div className="sec9-container">
      <div className="sec9-head">Get in touch with us</div>
      <div className="sec9-head2">
        We are a design company that emotes and innovates.
      </div>
      <div className="sec9-para">
        We take responsibility to increase your business tremendously with
        <br />
        technological advantage and support you to stand out uniquely and
        <br />
        consistently in the market.
      </div>
      <div className="sec9-icon">
        <div className="be">
          <img src={Be} alt="" />
          <img src={Be} alt="" />
        </div>
        <div className="in">
          <img src={In} alt="" />
        </div>
        <div className="twit">
          <img src={Be} alt="" />
        </div>
        <div className="insta"></div>
        <div className="facebook"></div>
      </div>
    </div>
  );
}

export default Gd;
